var pqMail = angular.module('pqMail', ['ui.bootstrap.alerts','ui.bootstrap.modal']);

/**
 * Primary Controller
 * TODO: Make separate controllers:
 * - MessageListController
 * - NavigationController
 * - ComposeController
 */
pqMail.controller('MessageListController', function ($scope)
{
	$scope.alerts = [];
	
	/* Compose Properties */
	$scope.recipientInput = "";
	$scope.recipients = [];
	$scope.message = "";
	
	/* Message List Properties */
	$scope.sentMessages = [];
	$scope.trashedMessages = [];
	$scope.messages = 
	[{
		'subject': 'Hey!',
		'avatar': img,
		'sender': 'Nestor'
	},
    {
		'subject': 'Ruby',
		'avatar': img,
		'sender': 'Mark'
	},
    {
		'subject': 'Angular',
		'avatar': img,
		'sender': 'Google'
	}];
	
	/**
	 * addAlert()
	 */
	$scope.addAlert = function(alertType, message)
	{
		$scope.alerts.push({type: alertType, msg: message});
	};
	
	/**
	 * closeAlert()
	 */
	$scope.closeAlert = function(index)
	{
		$scope.alerts.splice(index, 1);
	};
	
	/**
	 * compose()
	 * Opens compose modal.
	 */
	$scope.compose = function()
	{
		$scope.showModal = true;
	}
	
	/**
	 * decompose()
	 * Closes compose modal.
	 */
	$scope.decompose = function()
	{
		$scope.showModal = false;
	}
	
	/**
	 * send()
	 * Adds new message to inbox.
	 * Clears form and closes compose
	 * dialog when completed.
	 */
	$scope.send = function()
	{
		$scope.alerts = [];
		var errors = false;
		
		var email = $scope.recipientInput.trim();
		var ignoreAdditionalRecipientErrors = false;
		if(email.length != 0) {
			if(!$scope.validateEmail(email)) {
				$scope.addAlert("error", email + " is not a valid email address.");
				$scope.recipientInput = "";
				errors = true;
				ignoreAdditionalRecipientErrors = true;
			} else {
				var listed = $scope.containsRecipient(email);
				if(!listed) { $scope.addRecipient(email); }
			}
		}
		
		if($scope.message.length == 0) {
			$scope.addAlert("error", "Message cannot be left blank!");
			errors = true;
		}
		
		if($scope.recipients.length == 0 && !ignoreAdditionalRecipientErrors) {
			$scope.addAlert("error", "Recipients cannot be left blank!");
			errors = true;
		}
		
		if(errors) { return; }
		
		var newItem = 
		{
			'subject': $scope.message,
			'avatar': img,
			'sender': 'Nestor'
		}
		$scope.messages.push(newItem);
		$scope.items[0].count = $scope.messages.length;
		$scope.showModal = false;
		
		$scope.clearForm();
		$scope.addAlert("success", "Message sent!")
	}
	
	/**
	 * clearForm()
	 * Clears compose form properties.
	 */
	$scope.clearForm = function()
	{
		$scope.recipients = [];
		$scope.message = "";
		$scope.recipientInput = "";
	}
	
	/**
	 * checkRecipients()
	 * Checks for delimiter and adds valid recipients.
	 */
	$scope.checkRecipients = function()
	{
		$scope.alerts = [];
		var lastChar = $scope.recipientInput.substr($scope.recipientInput.length - 1);
		
		if(lastChar.localeCompare(";") == 0 || lastChar.localeCompare(",") == 0) {
			var email = $scope.recipientInput.substring(0, $scope.recipientInput.length - 1);
			if(!$scope.validateEmail(email)) {
				$scope.addAlert("error", email + " is not a valid email address.");
				$scope.recipientInput = "";
				return;
			}
			
			var listed = $scope.containsRecipient(email);
			if(!listed) { $scope.addRecipient(email); }
			$scope.recipientInput = "";
		}
	}
	
	/**
	 * addRecipient()
	 */
	$scope.addRecipient = function(email)
	{
		$scope.recipients.push({'email':email});
	}
	
	/**
	 * removeRecipient()
	 */
	$scope.removeRecipient = function(value)
	{
		newRecipients = [];
		for(var ii = 0; ii < $scope.recipients.length; ii++) {
			if($scope.recipients[ii].email.localeCompare(value) != 0) {
				newRecipients.push($scope.recipients[ii]);
			}
		}
		$scope.recipients = newRecipients;
	}
	
	/**
	 * containsRecipient()
	 * Returns true if recipients contains recipient.
	 */
	$scope.containsRecipient = function(recipient)
	{
		var contains = false;
		if($scope.recipients != null) {
			for(var ii = 0; ii < $scope.recipients.length; ii++) {
				if($scope.recipients[ii].email.localeCompare(recipient) == 0) {
					contains = true;
					break;
				}
			}
		}
		return contains;
	}
	
	/**
	 * validateEmail()
	 */
	$scope.validateEmail = function(email)
	{ 
		var re = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
		return re.test(email);
	} 
	
	/**
	 * Navigation items.
	 */
	$scope.items = 
	[{
		'label': 'Inbox',
		'count': $scope.messages.length,
		'uri': '/inbox'
	},
    {
		'label': 'Sent',
		'count': $scope.sentMessages.length,
		'uri': '/sent'},
    {
		'label': 'Trash',
		'count': $scope.trashedMessages.length,
		'uri': '/trash'
	}];
});

/**
 * Image for testing purposes.
 */
var img = "data:image/png;base64,"
